#include<iostream>
#include<string>
using namespace std;
int main()
{
    long long int x;
    int y,k=0;
    cin>>x>>y;
    string s=to_string(x);
    while(y!=0)
    {
        if(s[k]!='9')
        {
            s[k]='9';
            y--;
        }
        k++;
    }
    cout<<s;
}
